import React, { Component } from 'react';

class Nav extends Component {
    render() { 

        const linkDecoreation = {
            color: "#FFFFFF"
        }

        return(
            <nav>
                <h3>Logo</h3>
                <ul className="nav-links">
                    <Link to="about" style={linkDecoreation}>
                        <li>About</li>
                    </Link>
                    <Link to="card"  style={linkDecoreation}>
                        <li>Home</li>
                    </Link>
                </ul>
            </nav>
        );
    }
}

export default Nav;
